Flight No. SK 957, Star Jet bound for Delhi   
is set to take off from Chennai on a Monday   
morning. Terrorists in a team of five,        
disguised as passengers take over the Star    
jet flight,supposedly to effect the release   
of their leader, Yusuf Khan. The passengers'  
only hope is Major Ravindra from the National 
Security Guards who along with his team, Major
Nawaz Khan and Major Menon, captured Yusuf    
Khan 2 years ago.                             

